import React, { Component } from "react";

import { withRouter } from "react-router-dom";
import { connect } from "unistore/react";
import { actions } from "../store.js";
// import { Link } from 'react-router-dom';
import reactLogo from '../images/logo.svg';
import loginPict from "../images/loginpict.jpg";


class SignIn extends Component {

    doLogin = () =>{
        const self = this
        this.props.postLogin().then(()=>{
            console.log("this", this);
            self.props.history.replace("./profile");
        });
    };


    render(){
        console.log("signin", this.props);
        return(
            <section className="content signin">
            <form onSubmit={e=> e.preventDefault()}>
            <div fontSignHead style={{color:'black'}}>
            <img src={loginPict} style={{width:"20%"}} alt=""/>
            <div className="headerForm">
            <div className="container-fluid">
            <div className="row">
              <div className="col-md-11 col-sm-12 offset-md-0">
                <div id="myLogoBlack">
                  <p>WAWE</p>
                  <p style={{ fontSize: "30px" }}>WArunggaWE</p>
                </div>
                </div>
                </div>
            </div>
            </div>
            </div>
            <div>
                <input
                type = 'text'
                name = 'username'
                placeholder = 'Username'
                onChange={e => this.props.setField(e)}
                /> 
            </div>
            <div>
            <input
                type = 'password'
                name = 'password'
                placeholder = 'Password'
                onChange={e => this.props.setField(e)}
                /> 
            </div>
            <div className="buttonSign">
            <button onClick={() => this.doLogin()}>Sign in</button>
            <p>Belum punya akun? Daftar disini!</p>
            </div>
            </form>
            </section>

        );
    }
}

export default connect("is_login", "username", "pass", actions)(withRouter(SignIn));
